&quot;Badlapur&quot; is an upcoming Indian action-thriller film directed by Sriram Raghavan and produced by Dinesh Vijan and Sunil Lulla.The film stars Varun Dhawan and Nawazuddin Siddiqui in lead roles, with Huma Qureshi, Yami Gautam, Divya Dutta and Radhika Apte in supporting roles.The film will release on 20 February 2015.

Movie Name : &quot;Badlapur&quot; (2015)
Cast: Varun Dhawan, Nawazuddin Siddiqui, Yami Gautam, Huma Qureshi, Vinay Pathak, Radhika Apte &amp; Divya Dutta
Directed By: Sriram Raghavan
Produced By: Dinesh Vijan &amp; Sunil Lulla
Music By: Sachin &amp; Jigar
